import Vue from 'vue'
import Router from 'vue-router'

Vue.use(Router)

export default new Router({
  routes: [
    {
      path: '/',
      redirect: '/ios'
    },
    {
      path: '/ios',
      name: 'IOS',
      component: () => import(/* webpackChunkName: "IOS" */ '../views/IOS/Layout')
    },
    {
      path: '/qtg',
      name: 'QTG',
      component: () => import(/* webpackChunkName: "QTG" */ '../views/QTG/Layout')
    }
  ]
})
